import { fetchURL } from "../config";

const medFetch=  (body)=>{
    let result;
    fetch(fetchURL, {
        method: 'POST',
        headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json'
        },
        body: JSON.stringify(body)
    }).then((response) => {
        return response.json()})
        .then((json)=>{
            result = json.response;
        },(err) => {
            result=err
        }).catch((error) => {
            result=error
        });
    return {result}
    }
export default medFetch;
